const ContactMe = () => {
  return (
    <section className="contact">
      <div className="c-left">
        <div
          className="blur"
          style={{
            background: "rgb(238 210 255)",
            top: "17rem",
            width: "21rem",
            height: "11rem",
            left: "50rem",
          }}
        ></div>
        <div className="p-heading">
          <span>Get in Touch</span>
          <span>Contact me</span>
        </div>
      </div>
      <div className="c-right">
        <div
          className="blur"
          style={{
            background: "#c1f5ff",
            top: "12rem",
            width: "21rem",
            height: "11rem",
            left: "4rem",
          }}
        ></div>
      </div>
    </section>
  );
};

export default ContactMe;
